package br.com.argonavis.eipcourse.translator.filter;

import javax.jms.Connection;
import javax.jms.ConnectionFactory;
import javax.jms.Destination;
import javax.jms.JMSException;
import javax.jms.MessageProducer;
import javax.jms.Session;
import javax.jms.TextMessage;
import javax.naming.Context;
import javax.naming.InitialContext;

public class DataProducer {

	private String xml = "<document>"
			+ "<name>Fish.png</name>"
			+ "   <size>85393</size>"
			+ "   <type>PNG</type>"
			+ "   <owner><user>helder</user><address>helder@argonavis.com.br</address><legal>Creative Commons BY-SA</legal></owner>"
			+ "   <data></data>"
			+ "</document>";

	private Connection con;
	private Session session;
	private MessageProducer producer;

	DataProducer(Connection con, Destination destination) throws JMSException {
		session = con.createSession(false, Session.AUTO_ACKNOWLEDGE);
		producer = session.createProducer(destination);
	}

	public void send() throws JMSException {
		TextMessage message = session.createTextMessage(xml);
		message.setStringProperty("Type", "Base64+XML");
		System.out.println("Sending Message...");
		producer.send(message);
	}

	public static void main(String[] args) {
		Connection con = null;
		try {
			Context ctx = new InitialContext();
			ConnectionFactory factory = (ConnectionFactory) ctx
					.lookup("ConnectionFactory");
			con = factory.createConnection();
			Destination queue = (Destination) ctx.lookup("documents");

			DataProducer producer = new DataProducer(con, queue);
			System.out.println("Will send messages...");
			producer.send();
			System.out.println("Done.");

		} catch (Exception e) {
			e.printStackTrace();
		} finally {
			if (con != null) {
				try {
					con.close();
				} catch (JMSException e) {
				}
			}
		}
	}

}
